import React, { useEffect, useState } from 'react';
import { Table } from  'reactstrap';

function TopList(props){
    return (
        <Table hover>
            <thead>
                <tr>
                <th>#</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Username</th>
                </tr>
            </thead>
        </Table>
    );
}

export default TopList;
